import React, {useState, useEffect} from 'react';
import img from '../images/police.jpeg';
import { Container, Form, Row, Col, Image, Button, InputGroup} from 'react-bootstrap';

const axios = require('axios');

export default function EvidenceLog () {
    const [caseID, setCaseID] = useState([{}]);


    // const show = async () => {
    //     if (true) { 
    //         axios.get('http://localhost:3005/evidence/log/1', {
    //             params: {
    //                 caseID: ""
    //               }
    //         })
    //         .then(async (res) => {
    //             await getCaseID();
    //             setCaseID(null);
    //         });
    //     }       

    // }
    const submit = async () => {}

    useEffect(() => {
        axios.get('http://localhost:3005/caseID')
        .then((res) => {
            if (res) {
                setCaseID(res.data);
            }
    });
 }, []); 
    function onChangeText (event){
        return(event.target.value);
    }


    return (
        <Container fluid>
            <Row>
                <Col md={6}>
                    <h1>Evidence Log</h1>
                </Col>
            </Row>
            <Row>
                <Col md={3}>
                    <h5>Insert Case ID</h5>
                    <Button type="submit" class="btn btn-primary" onClick={submit}>
                        Enter
				    </Button>
                </Col>
		        <Col md={3}>
                <Form.Group className="mb-3" controlId="formBasicPassword">
                <Form.Label>Enter Case ID</Form.Label>
                <Form.Control type="text" placeholder="case ID" onChange={onChangeText}/>
                </Form.Group>
                </Col>
                <Col md={6}>
                   <Image src={img}/> 
                </Col>
            </Row>
        </Container>
    )
}
